import Sidebar from "./Sidebar";
import Dashboard from "./components/Dashboard";

export default function Layout({ user }) {
  return (
    <div className="flex">
      <Sidebar user={user} />
      <div className="flex-1">
        <Dashboard user={user} />
      </div>
    </div>
  );
}
